import React, { Component } from "react";
import "../styles/timeline.css";
import ToyImage from "./toyImage";
import Toy_UpTo90 from "../images/toy_upto90.svg";
import Toy_UpTo180 from "../images/toy_upto180.svg";
import Toy_UpTo270 from "../images/toy_upto270.svg";
import Toy_UpTo360 from "../images/toy_upto360.svg";
import Toy_UpTo450 from "../images/toy_upto450.svg";
import Toy_UpTo540 from "../images/toy_upto540.svg";
import Toy_UpTo630 from "../images/toy_upto630.svg";
import Toy_UpTo720 from "../images/toy_upto720.svg";

class ToyRowCard extends Component {
  render() {
    const images = {
      toy_upto90: Toy_UpTo90,
      toy_upto180: Toy_UpTo180,
      toy_upto270: Toy_UpTo270,
      toy_upto360: Toy_UpTo360,
      toy_upto450: Toy_UpTo450,
      toy_upto540: Toy_UpTo540,
      toy_upto630: Toy_UpTo630,
      toy_upto720: Toy_UpTo720,
    };
    const currentToyImage = images[this.props.toyRowCard.toyImage];
    //dynamic way to access image

    const { cardClass } = this.props.toyRowCard;
    return (
      <div className={cardClass}>
        <ToyImage currentToyImage={currentToyImage} />
      </div>
    );
  }
}

export default ToyRowCard;
